import React, { useEffect, useState } from 'react';
import { Routes, Route, Link, useNavigate } from 'react-router-dom';
import Login from './pages/Login';
import Signup from './pages/Signup';
import Dashboard from './pages/Dashboard';
import BookingPage from './pages/BookingPage';
import ServiceBooking from './pages/ServiceBooking';
import ContactUs from './pages/ContactUs';
import FAQ from './pages/FAQ';

function App(){
  const [token, setToken] = useState(localStorage.getItem('token'));
  const navigate = useNavigate();

  useEffect(()=>{
    setToken(localStorage.getItem('token'));
  }, []);

  const logout = () => {
    localStorage.removeItem('token');
    setToken(null);
    navigate('/login');
  }

  return (
    <div>
      <nav style={{ padding: 10, borderBottom: '1px solid #ddd' }}>
        <Link to="/" style={{ marginRight: 8 }}>Home</Link>
        <Link to="/booking" style={{ marginRight: 8 }}>Booking</Link>
        <Link to="/service" style={{ marginRight: 8 }}>Service</Link>
        <Link to="/contact" style={{ marginRight: 8 }}>Contact</Link>
        <Link to="/faq" style={{ marginRight: 8 }}>FAQ</Link>
        {token ? (
          <>
            <Link to="/dashboard" style={{ marginRight: 8 }}>Dashboard</Link>
            <button onClick={logout}>Logout</button>
          </>
        ) : (
          <>
            <Link to="/login" style={{ marginLeft: 8 }}>Login</Link>
            <Link to="/signup" style={{ marginLeft: 8 }}>Signup</Link>
          </>
        )}
      </nav>

      <div style={{ padding: 16 }}>
        <Routes>
          <Route path="/" element={<div><h2>Welcome to FuelNow</h2><p>Order fuel and get service at your door within an hour.</p></div>} />
          <Route path="/login" element={<Login setToken={t=>{ localStorage.setItem('token', t); setToken(t); }} />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/dashboard" element={<Dashboard token={token} />} />
          <Route path="/booking" element={<BookingPage token={token} />} />
          <Route path="/service" element={<ServiceBooking token={token} />} />
          <Route path="/contact" element={<ContactUs />} />
          <Route path="/faq" element={<FAQ />} />
        </Routes>
      </div>
    </div>
  );
}
export default App;
